import React, { useState, useEffect } from 'react';
import { getFormSubmissions, getSubmissionCount } from '../services/firebaseService';

const AdminPanel = () => {
  const [submissions, setSubmissions] = useState([]);
  const [submissionCount, setSubmissionCount] = useState(0);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [currentUserId, setCurrentUserId] = useState('');
  const [allSubmissions, setAllSubmissions] = useState([]);
  const [showAll, setShowAll] = useState(false);

  // Get current user ID from localStorage
  useEffect(() => {
    const userId = localStorage.getItem('formUserId');
    setCurrentUserId(userId || '');
  }, []);

  useEffect(() => {
    loadSubmissions();
  }, [currentUserId, showAll]);

  const loadSubmissions = async () => {
    try {
      setLoading(true);
      const [submissionsResult, countResult] = await Promise.all([
        getFormSubmissions(),
        getSubmissionCount()
      ]);

      if (submissionsResult.success) {
        setAllSubmissions(submissionsResult.data);

        if (showAll) {
          // Show all submissions (admin view)
          setSubmissions(submissionsResult.data);
        } else {
          // Show only current user's submissions
          const userSubmissions = submissionsResult.data.filter(
            submission => submission.userId === currentUserId
          );
          setSubmissions(userSubmissions);
        }
      } else {
        setError(submissionsResult.message);
      }

      if (countResult.success) {
        setSubmissionCount(countResult.count);
      }
    } catch (err) {
      setError('Failed to load submissions');
      console.error('Error loading submissions:', err);
    } finally {
      setLoading(false);
    }
  };

  const formatDate = (timestamp) => {
    if (!timestamp) return 'N/A';
    return new Date(timestamp.seconds * 1000).toLocaleString();
  };

  if (loading) {
    return (
      <div className="container">
        <div className="form-container">
          <h2>Loading submissions...</h2>
        </div>
      </div>
    );
  }

  return (
    <div className="container">
      <div className="form-container">
        <h1>Form Submissions Panel</h1>

        <div style={{ marginBottom: '20px', padding: '15px', backgroundColor: '#f8f9fa', borderRadius: '8px' }}>
          <p><strong>Your User ID:</strong> {currentUserId || 'Not found'}</p>
          <p><strong>Total submissions:</strong> {submissionCount}</p>
          <p><strong>Your submissions:</strong> {submissions.length}</p>
        </div>

        <div style={{ marginBottom: '20px' }}>
          <label style={{ display: 'flex', alignItems: 'center', gap: '10px' }}>
            <input
              type="checkbox"
              checked={showAll}
              onChange={(e) => setShowAll(e.target.checked)}
            />
            Show all submissions (Admin view)
          </label>
        </div>

        {error && (
          <div className="submit-message error">
            {error}
          </div>
        )}

        <button 
          onClick={loadSubmissions} 
          className="btn btn-primary"
          style={{ marginBottom: '20px' }}
        >
          Refresh
        </button>

        {submissions.length === 0 ? (
          <p>No submissions yet.</p>
        ) : (
          <div className="submissions-list">
            {submissions.map((submission) => (
              <div key={submission.id} className="submission-item">
                <div className="submission-header">
                  <h3>Submission #{submission.id.slice(-8)}</h3>
                  <span className="submission-date">
                    {formatDate(submission.submittedAt)}
                  </span>
                </div>
                <div className="submission-details">
                  <p><strong>Name:</strong> {submission.firstName} {submission.lastName}</p>
                  <p><strong>Date of Birth:</strong> {submission.dateOfBirth}</p>
                  <p><strong>Gender:</strong> {submission.gender}</p>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default AdminPanel;
